      </li>
      <li>
        <Link href="/about">About</Link>
      </li>
      <style jsx>{`
        ul {
          padding-left: 0;
          width: 20%;
          display: flex;

          list-style-type: none;
        }
      `}</style>
    </ul>
  );
}
export default Header;
